import React, { useState, useEffect } from "react";
import DetailWrapper from './DetailWrapper'; // Import the DetailWrapper
import { useNavigate } from "react-router-dom";

const carStatusMapping = {
  0: "Not Inspected",
  1: "Inspecting",
  2: "Inspected"
};

export const CarInspectionResults = () => {

  const navigate = useNavigate();
  const [cars, setCars] = useState([]);
  const [selectedCar, setSelectedCar] = useState(null);

  useEffect(() => {
    const fetchCars = async () => {
      const carData = [
        {
          carId: 1,
          name: "nEwXYz",
          status: 2,
          inspections: [
            { carInspectionId: 1, inspectionCriteria: { inspectionCriteriaId: 1, criteriaDesc: "Engine Check" }, note: null, good: true },
            { carInspectionId: 3, inspectionCriteria: { inspectionCriteriaId: 2, criteriaDesc: "Brake Condition" }, note: null, good: true },
            { carInspectionId: 4, inspectionCriteria: { inspectionCriteriaId: 3, criteriaDesc: "Tire Condition" }, note: null, good: true },
            { carInspectionId: 5, inspectionCriteria: { inspectionCriteriaId: 4, criteriaDesc: "Headlights & Signals" }, note: null, good: true },
            { carInspectionId: 6, inspectionCriteria: { inspectionCriteriaId: 5, criteriaDesc: "Windshields & Wipers" }, note: null, good: true }
          ]
        },
        {
          carId: 2,
          name: "newABC",
          status: 2,
          inspections: [
            { carInspectionId: 7, inspectionCriteria: { inspectionCriteriaId: 1, criteriaDesc: "Engine Check" }, note: null, good: true },
            { carInspectionId: 8, inspectionCriteria: { inspectionCriteriaId: 2, criteriaDesc: "Brake Condition" }, note: null, good: true },
            { carInspectionId: 9, inspectionCriteria: { inspectionCriteriaId: 3, criteriaDesc: "Tire Condition" }, note: null, good: true },
            { carInspectionId: 10, inspectionCriteria: { inspectionCriteriaId: 4, criteriaDesc: "Headlights & Signals" }, note: null, good: true },
            { carInspectionId: 11, inspectionCriteria: { inspectionCriteriaId: 5, criteriaDesc: "Windshields & Wipers" }, note: null, good: true }
          ]
        },
        {
          carId: 3,
          name: "newCDE",
          status: 0,
          inspections: []
        },
        {
          carId: 4,
          name: "newCDED",
          status: 0,
          inspections: []
        },
        {
          carId: 5,
          name: "12345",
          status: 0,
          inspections: []
        }
      ];

      setCars(carData);
    };

    fetchCars();
  }, []);

  const handleCarSelect = (e) => {
    const carId = e.target.value;
    const selectedCar = cars.find((car) => car.carId === parseInt(carId));
    setSelectedCar(selectedCar);
  };

  return (
    <div className="car-inspection-results">
      <h1>Car Inspection Results</h1>

      <div className="dropdown-container">
        <label htmlFor="car-dropdown">Inspected Car: </label>
        <select id="car-dropdown" onChange={handleCarSelect} defaultValue="">
          <option value="" disabled>Select a car</option>
          {cars.map((car) => (
            <option key={car.carId} value={car.carId}>
              {car.name} - {carStatusMapping[car.status]}
            </option>
          ))}
        </select>
      </div>

      {selectedCar && (
        <>
          <DetailWrapper> {/* Wrapping only the details in DetailWrapper */}
            <h2>Details for {selectedCar.name}</h2>
            <p>Status: {carStatusMapping[selectedCar.status]}</p>
            <h3>Inspections</h3>
            <ul>
              {selectedCar.inspections.length > 0 ? (
                selectedCar.inspections.map((inspection) => (
                  <li key={inspection.carInspectionId}>
                    {inspection.inspectionCriteria.criteriaDesc}:{" "}
                    {inspection.good ? "Passed" : "Failed"}
                  </li>
                ))
              ) : (
                <p>No inspections found.</p>
              )}
            </ul>
          </DetailWrapper>

          {/* Move the Add Inspection Button outside of the DetailWrapper */}
          <button className="add-inspection-btn" onClick={handleAddInspection}>
            Add New Inspection
          </button>
        </>
      )}
    </div>
  );
};
